import './App.css';


function App() {
  return (
    <>
    <div className="App">
      <h1>Hello buddy!</h1>
    </div>
    <div><p>hello there</p></div>
    <button style='color: green' onClick={() => {
      const name = prompt("What's your name?");
      alert(`Hey there ${name}!`);
    }}>Greet</button>
    </>
  );
}

export default App;
